INSERT INTO listing(price, specificAttribute, brand, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (18998, 'new', 'mazda', '2016 Mazda 6i Sport Sedan 4D', 'The 2016 Mazda6 is a good choice if you want to add some fun to your daily commute. Unlike most midsize cars, it has a powerful engine and spirited handling that make it a joy to drive. It also earns good gas mileage, performs well in crash tests, and has a classy interior. Not all is good, however; the ride can be a bit harsh. Why You Can Trust Us Our used car rankings and reviews are based on our analysis of professional automotive reviews, as well as data like crash test scores, reliability ratings, and ownership expenses. We researched 36 Mazda6 reviews to help you decide if its the right used car for you. The U.S. News Best Cars team has been ranking cars, trucks, and SUVs since 2007, and our staff has a combined 75 years of automotive industry experience. To ensure our impartiality, our staff never takes expensive gifts or trips from car companies, and an outside team handles the advertising on our site.', 'vehicles', 'sedans', '35.373291', '-119.018715', '06bcfefa-b4d5-4516-b65a-3e7a3f587498', ARRAY['https://static.cargurus.com/images/forsale/2021/11/12/00/36/2016_mazda_mazda6-pic-1463408096809861067-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/12/00/36/2016_mazda_mazda6-pic-6728967871357021994-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/12/00/36/2016_mazda_mazda6-pic-2321576291294866234-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/12/00/36/2016_mazda_mazda6-pic-328002695999406149-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/12/00/36/2016_mazda_mazda6-pic-3667805303528256884-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/12/00/36/2016_mazda_mazda6-pic-2913531182124470524-1024x768.jpeg']);
INSERT INTO listing(price, specificAttribute, brand, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (21890, 'new', 'honda', '2018 Honda Accord 1.5T LX FWD', 'ALG Residual Value Awards, Residual Value Awards. Delivers 38 Highway MPG and 30 City MPG! This Honda Accord Sedan boasts a Intercooled Turbo Regular Unleaded I-4 1.5 L/91 engine powering this Variable transmission. Wheels: 17" Silver-Painted Alloy, VSA Electronic Stability Control (ESC), Valet Function. This Honda Accord Sedan Features the Following Options. Trunk Rear Cargo Access, Trip Computer, Transmission: Continuously Variable, Tires: 225/50R17 AS, Systems Monitor, Strut Front Suspension w/Coil Springs, Steel Spare Wheel, Speed Sensitive Variable Intermittent Wipers, Single Stainless Steel Exhaust, Side Impact Beams. This Honda Accord Sedan is a Superstar! ALG Residual Value Awards, Residual Value Awards, NACTOY 2018 North American Car of the Year, KBB.com Brand Image Awards, KBB.com 10 Most Awarded Brands. Visit Us Today Treat yourself- stop by Golden State Nissan located at 650 Serramonte Blvd, Colma, CA 94014 to make this car yours today!', 'vehicles', 'sedans', '37.686503', '-122.474633', 'd5e8810f-fec6-4f1e-a346-6fa91c88d909', ARRAY['https://static.cargurus.com/images/forsale/2021/11/11/16/20/2018_honda_accord-pic-6185063032861258750-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/11/16/20/2018_honda_accord-pic-2109287041351129518-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/11/16/20/2018_honda_accord-pic-1217146177103358016-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/11/16/20/2018_honda_accord-pic-2723785320852790227-1024x768.jpeg', 'https://static.cargurus.com/images/forsale/2021/11/11/16/20/2018_honda_accord-pic-2428491572391247646-1024x768.jpeg']);
INSERT INTO listing(price, specificAttribute, brand, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (12499, 'used', 'ducati', '2014 Ducati Superbike 899', 'The Ducati Panigale 899 has revolutionary technology found in the Monoscocca frame and Superquadro engine, 148 HP delivered with incredible lightness and unprecedented agility in its unmistakable design. Ducati Quick Shift and ABS were fitted as standard this year. This all ensures that the 899 Panigale is just the bike to give a Ducati Superbike adrenalin rush, both on the track and on the road. This bike has been through our service department and passed an 89 pt. reconditioning & inspection process. Some of the points include a check of all the fluids, inspection of all wear items, an electrical & charging system test, safety & lighting check, adjustment of controls, torque check of major fasteners, a diagnostic check with a scanner, and of course a test ride to check for proper operation of the bike. Our techs also mounted and balanced a new front tire. This 899 was brought to us by a local Ducati enthusiast with only a thousand miles on it. Featured in satin white, its in completely stock configuration.', 'vehicles', 'motorcycles', '37.549590', '-122.306981', '730b4c65-ee57-4fd2-96c4-e69f8946c58c', ARRAY['https://1.cdn.autotraderspecialty.com/2014-Ducati-Superbike%20899-motorcycle--Motorcycle-201180085-e6a65ac512a162ee5516e516f4e31f3a.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://1.cdn.autotraderspecialty.com/2014-Ducati-Superbike%20899-motorcycle--Motorcycle-201180085-289d2ea75ac618810dc280362a16c49f.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://0.cdn.autotraderspecialty.com/2014-Ducati-Superbike%20899-motorcycle--Motorcycle-201180085-3228b219b792fc1286104473df3fb461.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://1.cdn.autotraderspecialty.com/2014-Ducati-Superbike%20899-motorcycle--Motorcycle-201180085-00a3e803a0291704e98108962baeaa12.jpg?r=pad&w=735&h=551&c=%23f5f5f5', '