INSERT INTO listing(price, specificAttribute, brand, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (11995, 'new', 'harley-davidson', '1994 Harley-Davidson Softail Springer', '80"/1340cc V2 Evolution Engine.  5-Speed Transmission.  Violet Pearl/Platinum Silver Paint.  18,175 Original Miles. Extras Include:  40" Gooseneck Chrome Drag Pipes w/ Heat Shields.  Lepera 2-Up Basketweave Seat.  Heel Stirrups.  Chrome Phantom Axle Covers, Front Axle Covers, Oil Pump, Upper/Lower Belt Guard, Coil Cover, and Swingarm Pivot Cover.  Upgraded Front/Rear Foot Pegs.  Chrome Dash Panel. VIN# 1HD1BLL12RY023684 Full Payment via Bank-to-Bank Wire Transfer, Cashiers Check, Bank Check, Cash in Person, or Loan Check, is Due Within 7 Days of Initial Deposit. There is a $149 Documentary Fee that covers Purchase/Shipping Paperwork Costs. Additionally, there is a $349 Dealer Preparation Fee that Includes: Dealer Safety/Mechanical Service, Fresh Fluids, and a 30-Day In-House Warranty. We also offer/recommend Dyno-Tuning Service. Please Inquire for Details!', 'vehicles', 'motorcycles', '36.970238', '-121.981142', 'd5e8810f-fec6-4f1e-a346-6fa91c88d909', ARRAY['https://0.cdn.autotraderspecialty.com/1994-Harley-Davidson-Softail-motorcycle--Motorcycle-200437126-0ea945c9acab692b31a506a993cd8b19.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://1.cdn.autotraderspecialty.com/1994-Harley-Davidson-Softail-motorcycle--Motorcycle-200437126-53e33f64a136d056a4559647237916a0.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://1.cdn.autotraderspecialty.com/1994-Harley-Davidson-Softail-motorcycle--Motorcycle-200437126-6597bb92bfc931136c1025914fe45c5c.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://1.cdn.autotraderspecialty.com/1994-Harley-Davidson-Softail-motorcycle--Motorcycle-200437126-504accc12b60f94ecf7d47d73e7ac79a.jpg?r=pad&w=735&h=551&c=%23f5f5f5', 'https://0.cdn.autotraderspecialty.com/1994-Harley-Davidson-Softail-motorcycle--Motorcycle-200437126-51cab7bde2cbce1bf1230c441869274