INSERT INTO listing(price, specificAttribute, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (650, 'string', 'Gretsch G5420T Hollow Body Electric Guitar', 'Up for sale is a beautiful Gretsch G5420T with hard case. Asking $650. No low ball offers please. This is the Bigsby tremelo model in the classic orange stain color. The Guitar is in excellent condition with only one very small ding above the Bigsby mount, as pictured. From Gretsch: No nonsense, Electromatic hollow-body guitars are the perfect real, pure and powerful Gretsch instruments. They"re your next-step Gretschbold, dynamic and articulate, and crafted with essential Gretsch sound, style and playability. Alive and resonant, the G5420T has fully hollow build with a true Filter Tron voice that explodes with huge punch and clear, strong presence. Like all Electromatic guitars, it delivers the fearless and electrifying authenticity that has set Gretsch apart as the quintessential rock n roll guitars from the very beginning. Its the sound of honor itselfplay proud.', 'instruments', 'String', '37.296816', '-121.876434', '1e6caea0-b4d8-4a9e-8fb0-af3bad10cd57', ARRAY['https://images.craigslist.org/00c0c_aZtUjW71D4mz_0t20CI_600x450.jpg', 'https://images.craigslist.org/00K0K_jAaXoOMwbiDz_0t20CI_600x450.jpg', 'https://images.craigslist.org/00n0n_jRkpi1MzKHAz_0t20CI_600x450.jpg', 'https://images.craigslist.org/00E0E_l9q3hE1oV83z_0t20CI_600x450.jpg', 'https://images.craigslist.org/00101_kAfhpdZSIKFz_0t20CI_600x450.jpg','https://images.craigslist.org/00g0g_5TfadZ4JW4iz_0t20CI_600x450.jpg','https://images.craigslist.org/00l0l_5ZDv4YBNNPaz_0CI0t2_600x450.jpg']);
INSERT INTO listing(price, specificAttribute, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (114, 'brass', 'Etude ETR-100 Trumpet Lacquer', 'The Etude ETR-100 Student Trumpet"s generous bore makes it easy for a beginner to play while learning to form notes accurately. You"ll be heard on your ETR-100 trumpet whether you"re performing on stage or with your marching band thanks to the Etude trumpet"s red brass lead pipe-crafted for easy tone production and great projection. More trumpet players drop the instrument in the first year or two than in any other. Oftentimes, the reasons are as much mechanical as they are musical. With the Etude ETR-100, a satisfying bleat often pops out of the end of the horn within the first couple of attempts. Then, as the valves become less of a mystery, you can count on smooth action and precise note slotting. And that"s how it all begins. These little victories early on in a student"s playing are critical to developing a generally positive association with the horn. If the trumpet is seen as an intimidating, uncooperative hunk of metal, practice time will create feelings of intimidation and irritation. If the trumpet is seen as that really cool-looking, really loud thing that my parents got for me, well, that"s a different story altogether.', 'instruments', 'Brass', '37.933592', '-122.349973', '06bcfefa-b4d5-4516-b65a-3e7a3f587498', ARRAY['https://images.craigslist.org/00E0E_4BRNDuFbdgUz_0CI0t2_600x450.jpg', 'https://images.craigslist.org/00606_adwHL7dCxZgz_0CI0t2_600x450.jpg', 'https://images.craigslist.org/00q0q_as8BC7zNSqoz_0CI0t2_600x450.jpg', 'https://images.craigslist.org/00202_i5LE4zQyepwz_0t20CI_600x450.jpg', 'https://images.craigslist.org/00P0P_ge9aApp663fz_0t20CI_600x450.jpg']);
