INSERT INTO listing(price, specificAttribute, title, description, category, subcategory, latitude, longitude, userId, images) VALUES (399, 'microsoft', 'Microsoft Surface Duo - 128GB', 'Surface Duo combines the Google AndroidTM operating system with the best Microsoft 365 appsincluding apps like Microsoft Office, Outlook, Microsoft Teams, OneDrive, Microsoft Edge, and more. All these Microsoft apps are built for Surface Duo to help you get more done throughout your day. Since it runs on Android, you can download any other apps and games you want from the Google Play Store. (Some apps and features may require a wireless plan, additional subscriptions, or fees.) Surface Duo has a Revolutionary Hinge, so you can fold it however you want. It adapts to you. Hold it like a book and have tow apps open side-by-side with one on each screen. No need to switch back and forth between two apps anymore. To learn more, see Different ways to use Surface Duo or open the Tips app on your Surface Duo.', 'technology', 'microsoft', '37.440201', '-121.900676', '9e8766c6-9495-4348-b916-f11852babf22', ARRAY['https://i.ebayimg.com/images/g/ABsAAOSwtaBhp~84/s-l1600.jpg', 'https://i.ebayimg.com/images/g/GxIAAOSwALVhp~82/s-l1600.jpg', 'https://i.ebayimg.com/images/g/AwoAAOSwSo5hp~83/s-l1600.jpg', 'https://i.ebayimg.com/images/g/~AwAAOSw~3dhp~86/s-l1600.jpg']);


